(1, '新力锦园', '青云谱区', '2018-09-30', '&lt;p&gt;【项目名称】新力锦园&lt;br&gt;【开发商】 新力地产&lt;br&gt;【板块】青云谱&lt;br&gt;【开盘时间】2018年9月30日&lt;br&gt;【开盘地点】新力锦园售楼处&lt;br&gt;【推售楼栋、户型】&lt;br&gt;高层2、3、4#、 面积段中间户99平，端户118平 3房两卫；总房源套数： 358套，去化 245套，去化率 70% ；&lt;br&gt;【前期认筹数量】共认筹约 510组&lt;br&gt;【现场到访人数】约 300组&lt;br&gt;【优惠政策】 开盘995折，一次性付款再享98折，按揭99折&lt;br&gt;【车位情况】 本次开盘未捆绑车位，后期车位预计15万元/个&lt;br&gt;【价格情况】限价 14990元/平米；精装售价 14900元/平米。&lt;br&gt;【客户情况】客户主要来源于 广州路沿线、洪都等区域。&lt;br&gt;【蓄客周期】 4 个月&lt;/p&gt;');
INSERT INTO `f_tudi` (`id`, `tudi_id`, `city_name`, `weizhi`, `yongtu`, `rongjilv`, `midu`, `lvdi`, `fa_time`, `chengjiao_time`, `jiezhi_time`, `baozhengjin`, `mianji_m`, `mianji_p`, `guihua_p`, `qipaijia`, `chengjiaodanjia`, `chengjiazongjia`, `loumiandijia`, `yijialv`, `jingderen`, `qishijia`, `dituweizhi`, `xuzhi`, `is_cheng`) VALUES
(1, 'DAFJ2014046', '高新区', '南昌高新区京东大道以西、东元路以北、东元机电以南、高新五路以东', '商业、商务、居住用地', '1.0＜容积率≤4.25（其中地下商业容积率)', 'D≤50%', 'GAR≥15%', '2014-08-01', '2014-08-22 10:00:00', '2014-08-20 15:00:00', '24000.00', '24000.0000', '154.2630', '102842.0000', '437078.50', '400.00', '400.00', '1411.80', '0%', '香港卓盛发展有限公司', '61705.20', '../uploads/1412041897.png', '&lt;p&gt;1、为了保障土地竞买保证金收退工作及时、无误，竞买人须以转帐方式及时足额缴纳竞买保证金。&lt;/p&gt;&lt;p&gt;2、据有关文件精神本次交易服务费按《交易服务费交纳通知书》50%收取；&lt;/p&gt;&lt;p&gt;3、具体规划条件详见南昌市城乡规划局（洪规函[2018］306号）,具体出让要求详见公开出让方案；&lt;/p&gt;&lt;p&gt;4、宗地受让人须在宗地范围内按市规划部门先行批准的地块详规配建21650.16㎡安置房,共306户。建成后无偿移交给南昌工业控股集团有限公司,由其负责分配等安置工作；&lt;/p&gt;&lt;p&gt;5、为保证安置房的建设,宗地受让人在签订《土地成交确认书》后5个工作日内,与青云谱区政府、南昌工业控股集团有限公司签订《八一麻纺厂生活区棚户区改造项目配建安置房建设协议书》并缴纳配建安置房建设保证金2仟万元后,方可签订《国有建设用地使用权出让合同》；&lt;/p&gt;&lt;p&gt;6、宗地B地块内9.999亩公共绿地不在出让范围内,不计入规划指标,受让人需按照规划要求无偿建设并移交给属地政府；&lt;/p&gt;&lt;p&gt;7、宗地内配建安置房在交付土地后6个月开工,剩余建筑与其主体建筑同步建设,建成竣工、验收合格并完成交付后,宗地内商品房方可在房管局办理预售许可证；&lt;/p&gt;&lt;p&gt;8、地块内地上、地下各种管线管网的迁移整改等事宜，由竞得人按照规划规定要求自行负责处理。宗地内电线杆由受让人自行迁移,费用自理。竞买人报名参与竞买后视作对宗地内电线杆的现状无异议,不得以此为由欠缴土地出让金、逾期开竣工或主张其他任何权益；&lt;/p&gt;&lt;p&gt;9、至宗地公开出让公告截止报名日,在南昌市存在欠缴土地出让金的个人、企业及其关联企业,不得参与宗地竞买。具体要求详见公开出让方案；&lt;/p&gt;&lt;p&gt;10、地块竞买资金（即土地出让价款，含竞买保证金）须为竞买人自有合法合规资金。如宗地竞买资金不符合要求的，尚未签订出让合同的取消竞得人资格，宗地保证金不予退还，已签订出让合同的，经批准收回国有建设用地使用权，合同定金不予退还。同时，将违规竞得人列入南昌市土地市场诚信系统黑名单，一年内不得参加南昌市土地市场的公开竞买；&lt;/p&gt;&lt;p&gt;11、宗地所建住宅的控制性房屋销售价格(均价)上限为12500元/㎡(毛坯价)。宗地成交后,在《国有建设用地使用权出让合同》中明确竞得人接受宗地商品住宅销售均价上限；&lt;/p&gt;&lt;p&gt;12、宗地的商品住宅(简称“三限房”)销售,按照“限房价、竞地价”项目的商品住宅销售相关政策规定执行；&lt;/p&gt;&lt;p&gt;13、宗地的商品住宅项目中户型面积144㎡(含)以下实施全装修建设。具体要求详见公开出让方案；14、宗地中普通商品住宅（144㎡以下）的建筑面积占住宅总建筑面积的比例不低于70%\r\n\r\n&lt;/p&gt;', '竞价成功'),
(2, 'DAEJ2014045', '红谷滩新区', '红谷滩新区西客站地区学府南大道以东、海宝街以南（HJZ702-G01地块）', '商业、商务、二类居住用地', '1.0＜FAR≤2.2', 'D≤35%', 'GAR≥25%', '2014-08-05', '2014-09-01 10:00:00', '2014-08-29 15:00:00', '4000.00', '41.5510', '27700.9600', '437078.5000', '400.00', '0.00', '0.00', '0.00', '', '', '0.00', '../uploads/1411805283.png', '出让地块基本情况及使用条件 <br />\n  （一）地块编号：DAEJ2014045；\n   （二）地块位置：红谷滩新区西客站地区学府南大道以东、海宝街以南（HJZ702-G01地块）；<br />\n   （三）地块四至范围：东至规划路；南至礼庄街；西至学府大道、北至海宝街；<br />\n   （四）出让面积：41.551亩；<br />\n   （五）土地用途：住宅用地；<br />\n   （六）规划容积率：1.0＜FAR≤2.2；<br />\n   （七）规划建筑密度：D≤35%；<br />\n   （八）绿地率：GAR≥25%；<br />\n   （九）土地开发程度：拆迁后的自然状态；<br />\n   （十）土地使用权出让年期：住宅用地70年，商业、商务用地40年；<br />\n   （十一）投资强度：无；<br />\n   （十二）交地时间：签订土地出让合同则视为土地交付；<br />\n   （十三）动工时间：签订国有建设用地使用权出让合同后9个月内必须动工；<br />\n   （十四）竣工时间：开工后二年内必须竣工；<br />\n   （十五）土地成交价款缴纳方式及时间：签订土地出让合同后一个月内缴款50%(包含竞买保证金)，余款在签订出让合同之日起六个月内缴清；<br />\n   境外投资者竞得土地使用权的，首期应付款暂定自竞得之日起50天内交纳，余款按合同约定及时交纳，最迟付款时间不得超过一年。<br />\n   （十六）依法依规需要说明宗地的其他情况：具体规划条件详见南昌市城乡规划局洪规字[2014]255号文： 1.土地用途：商业、商务、二类居住用地 2．机动车位：住宅按0.8PS/100平方米建筑面积配置；商务办公按0.8PS/100平方米建筑面积配置；商业按1.0PS/100平方米建筑面积配置； 3．非机动车位：适当位置集中布置； 4．主出入口方位：24米规划道路； 5．建筑间距：按《南昌市城市规划管理技术规定》执行； 6．建筑高度：住宅建筑不得低于5层； 7．退离红线：按《南昌市西客站地区控制性详细规划调整》执行； 8. 小户型比例：套型建筑面积90平方米以下占住宅计容积率总建筑面积比例不小于30%； 9. 其它： 1）、商业、商务计容积率建筑面积不小于总计容积率建筑面积的30%； 2）、配套商业相对集中布置； 3）、按《南昌市西客站地区控制性详细规划调整》执行； 。<br />\n\n   竞买申请条件及要求 <br />\n   中华人民共和国境内外的法人、自然人和其他组织，符合网上出让公告或出让须知中明确的资格条件，均可申请参加本次国有建设用地使用权网上拍卖出让活动。竞买申请人可以单独申请，也可以联合申请。', '交易不成功'),
(3, 'DAEJ2014047', '高新区', '高新区京东大道以西、省电力设计院以南', '商业、商务用地', 'FAR≤2.4', 'D≤40%', 'GAR≥25%', '2014-08-21', '2014-09-12 10:00:00', '2014-09-10 15:00:00', '5800.00', '5800.0000', '48.3255', '32217.0000', '77320.80', '240.00', '11598.12', '1500.00', '0%', '浙江浙大网新集团有限公司，江西赣能股份有限公司，杭州网新睿昌投资合伙企业（有限合伙）', '11598.12', '../uploads/1411805284.png', '出让地块基本情况及使用条件 \r\n\r\n   （一）地块编号：DAFJ2014047；\r\n   （二）地块位置：高新区京东大道以西、省电力设计院以南；\r\n   （三）地块四至范围：东至京东大道、南至火炬二路、西至高新六路、北至省电力设计院用地；\r\n   （四）出让面积：48.3255亩；\r\n   （五）土地用途：商服用地；\r\n   （六）规划容积率：FAR≤2.4；\r\n   （七）规划建筑密度：D≤40%；\r\n   （八）绿地率：GAR≥25%；\r\n   （九）土地开发程度：拆迁后自然状态；\r\n   （十）土地使用权出让年期：40年；\r\n   （十一）投资强度：无；\r\n   （十二）交地时间：签订土地出让合同则视为土地交付；\r\n   （十三）动工时间：签订土地出让合同后九个月内必须开工；\r\n   （十四）竣工时间：开工后两年内必须竣工；\r\n   （十五）土地成交价款缴纳方式及时间：签订土地出让合同后一个月内支付土地出让金总额的50%（含竞买保证金），剩余土地出让金六个月内一次性付清；\r\n   境外投资者竞得土地使用权的，首期应付款暂定自竞得之日起50天内交纳，余款按合同约定及时交纳，最迟付款时间不得超过一年。\r\n   （十六）依法依规需要说明宗地的其他情况：1、用地性质：商业、商务用地；2、退离红线：建筑控制线退京东大道道路红线不得小于10米，退高新六路道路红线不得小于8米，退其他周边用地红线距离按《南昌市城市规划管理技术》执行；3、建筑间距：按《南昌市城市规划管理技术》执行；4、主出入口位置：高新六路或京东大道；5、地块标高：以高新六路标高进行控制；6、机动车停车位：商业 ：1.0泊位/100平方米建筑面积；办公：0.8泊位/100平方米建筑面积；旅馆业：0.4泊位/客房；餐饮、娱乐业：2.5泊位/100平方米建筑面积，7、竞买人或竞买人控股子公司（含相对控股）需为国家工信部认定的2012年中国软件业务收入前十强企业；8、项目建成后，竞得人需自持物业面积不低于10000平方米；剩余物业面积只能出售给同类产业的企业法人（受让资格认定由市外经贸委会同高新区管委会负责，并以市外经贸委为主），产权登记包括今后转让主体和对象仅限于企业法人，不得为自然人；9、在宗地成交后提交资格审查文件时，竞得入选人须提供合法有效的证明材料，方可签订《土地成交确认书》，如竞得入选人无法提供合法有效的证明材料，则宗地成交无效，其竞买保证金不予退还。\r\n\r\n 竞买申请条件及要求 \r\n   中华人民共和国境内外的法人、自然人和其他组织，符合网上出让公告或出让须知中明确的资格条件，均可申请参加本次国有建设用地使用权网上拍卖出让活动。竞买申请人可以单独申请，也可以联合申请。', '竞价成功'),
(4, 'DAEJ2014054', '西湖区', '1212132132', '12123132', '1.0＜FAR≤2.273', 'D≤30.46%', 'GAR≥30%', '2018-10-01', '2018-10-23 16:04:04', '2018-10-21 16:04:07', '1000.00', '100.0000', '66667.7000', '1000.0000', '10000.00', '0.00', '0.00', '0.00', '', '', '1000000.00', '', '', '公告中'),
(5, 'DADJ2018038', '青云谱区', '青云谱区象湖东岸施尧路以东、昌南大道以北（控规CN107-C03地块）', '二类居住用地', '1＜FAR≤3.0', 'D≤30.46%', 'GAR≥30%', '2018-10-09', '2018-10-25 10:54:17', '2018-10-22 10:54:19', '33000.00', '62.9820', '41988.6508', '125964.0000', '870.80', '0.00', '0.00', '0.00', '', '', '54844.73', '', '&lt;p&gt;1、为了保障土地竞买保证金收退工作及时、无误，竞买人必须以转账方式及时足额缴纳竞买保证金。&amp;nbsp;&lt;/p&gt;&lt;p&gt;2、具体规划要求详见湾里区城乡规划建设局（用地规划条件[2018]第005号）及南昌市城乡规划局（洪规函[2018]204号），具体出让要求详见公开出让方案。&lt;/p&gt;&lt;p&gt;3、据有关文件精神本次交易服务费按《交易服务费交纳通知书》50%收取。4、商务设施计容建筑面积占开发计容总建筑面积比例按不小于50%控制，商务设施性质物业自持年限不少于10年,时间从办理房屋不动产首次登记登簿之日起算。5、该宗地采取“限房价、竞地价”方式出让，根据南昌市住房保障和房产管理局洪房文〔2018〕144号文件精神，宗地所建住宅的控制性房屋销售价格（均价）上限为7600元/平方米。宗地中普通商品住宅(144平方米以下)的建筑面积占住宅总建筑面积的比例不低于70%。6、“限房价、竞地价”项目的商品住宅（简称“限价房”）销售，具体要求详见公开出让方案。7、该宗地住宅项目中户型面积90平方米（含）以下实施全装修建设，具体要求详见公开出让方案。8、宗地竞买资金（即土地出让价款，含竞买保证金）须为竞买人自有合法合规资金。具体要求详见公开出让方案。9、至宗地公开出让公告截止报名日，在南昌市存在欠缴土地出让金的个人、企业及其关联企业，不得参与宗地竞买。具体要求详见公开出让方案。10、竞买申请一经受理确认后，即视为竞买人对《出让文件》内容及宗地现状无异议并全面接受。具体要求详见公开出让方案\r\n\r\n&lt;/p&gt;', '公告中');
